import Head from "next/head";
import Layout, { siteTitle } from "../components/layout";
import utilStyles from "../styles/utils.module.css";
import styles from "../components/layout.module.css";
const name = "Ila Sahu";
const space = " &nbsp";
export default function Home() {
  return (
    <Layout home>
      <Head>
        <title>{siteTitle}</title>
      </Head>

      <section className={utilStyles.headingMd}>
        <div className={styles.firstFold}>
          <>
            <div
              className={`${styles.column}  ${styles.floatRight} ${
                styles.col - s - 2
              }  ${styles.pt3} `}
            >
              <img
                src="/images/ila.png"
                className={`${styles.headerHomeImage} ${styles.positionAbsolute} ${utilStyles.borderCircle}`}
                alt={name}
              />
            </div>
            <div className={`${styles.column}  ${styles.col - s - 2}`}>
              &nbsp;
            </div>
            <div
              className={`${styles.column}  ${styles.col - s - 2} ${
                styles.textLeft
              } `}
            >
              <h1>Hey, I am Ila!</h1>
              <p className={` ${styles.headerMenu} ${styles.lineHeight0}`}>
                Software • Baking • Fitness • Meditation
              </p>
            </div>
          </>
        </div>
        <div className={styles.secondFold}>
          <></>
        </div>
      </section>
    </Layout>
  );
}
